JavaScript (script.js):
```javascript
function validateForm() {
  var email = document.getElementById("email").value;
  var password = document.getElementById("password").value;

  // Client-side validation for email format
  var emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
  if (!emailRegex.test(email)) {
    document.getElementById("error").innerHTML = "Invalid email format.";
    return false;
  }

  // Client-side validation for password requirements
  var passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[!@#$%^&*])[A-Za-z\d!@#$%^&*]{8,}$/;
  if (!passwordRegex.test(password)) {
    document.getElementById("error").innerHTML = "Invalid password format.";
    return false;
  }

  // Server-side validation to check if email address is already registered
  var xhttp = new XMLHttpRequest();
  xhttp.onreadystatechange = function() {
    if (this.readyState == 4 && this.status == 200) {
      var response = JSON.parse(this.responseText);
      if (response.exists) {
        document.getElementById("error").innerHTML = "Email address is already registered.";
      } else {
        document.getElementById("registrationForm").submit();
      }
    }
  };
  xhttp.open("POST", "check_email.php", true);
  xhttp.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
  xhttp.send("email=" + email);

  return false; // Prevent form submission
}
```

